    [],nt"revision_timestamp": "2016-07-27T22:56:35.087654",nt"name": "rice-lake-national-wildlife-refuge-including-mille-lacs-and-sandstone-annual-narrative-rep-94edf",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Rice Lake
    National Wildlife Refuge and Mille Lacs National Wildlife Refuge outlines Refuge
    accomplishments during the 1990 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. Land acquisition is covered. The
    report includes a planning section which discusses the master plan, management planning,
    public participation, compliance with environmental and cultural resource mandates,
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, other manpower programs, volunteer programs, funding,
    safety, and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, grazing, haying, fire management,
    pest control, water rights, and wilderness and special areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, other resident wildlife,
    fisheries resources, wildlife propagation and stocking, animal control, and marking
    and bird banding. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, other wildlife oriented recreation, picnicking, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment utilization and replacement,
    communication systems, computer systems, and energy conservation. Cooperative programs
    and items of interest are provided at the end. Refuge brochures are attached.",nt"license_title":
